				url: server_url + '/indexes/AlbumsByCountSold',
				json: {"Name":null,"Map":"from album in docs.Albums\nselect new { album.CountSold };","Maps":["from album in docs.Albums\nselect new { album.CountSold };"],"Reduce":null,"TransformResults":null,"IsMapReduce":false,"IsCompiled":false,"IsTemp":false,"Stores":{},"Indexes":{},"SortOptions":{},"Analyzers":{},"Fields":[],"Type":"Map"}
